import React from 'react';
import logo from './logo.svg';
import './App.css';
import 'bootstrap/dist/css/bootstrap.css'

function App() {
  return (
    <div className="App">
     <div className="container">
       <div className="col-6">Column number one </div>
       <span>
         <i className="fas fa-home" />
       </span>
       <div className="col-6">Column number one </div>
     </div>

    </div>
  );
}

export default App;
